(56, 15, '14/03/2017', '21/03/2017', 'Nos dedicamos a la maquinaria de obra pública (excavadoras, palas cargadoras, retroexcavadoras…) Necesito a alguien que tenga buenos conocimientos de Hidráulica, que sepa leer esquemas, que entienda de electricidad. Se valorará conocimiento de maquinaria agrícola ', 'Vitoria', 'Cualquiera', 'Cualquiera', 29),
