(65, 5, '29/04/2017', '19/05/2017', 'La empresa CAF (Construcción Auxiliar del Ferrocarril) dispone de centros de trabajo en Lebario (Durangaldea), Araso (Irun-Renteria), Vitoria y Bilbao. \r\n\r\nQuieren contar con estudiantes de Grado Superior dispuestos a trabajar en mantenimiento de las titulaciones:\r\n·       Mantenimiento Electrónico\r\n·       Mecatrónica industrial\r\n·       Transporte y mantenimiento de vehículos (automoción)\r\n·       Diseño Mecánico / Programación de la Producción\r\n\r\nSu intención es darles experiencia internacion', 'Vitoria', 'Cualquiera', 'Cualquiera', 38),
(66, 15, '03/05/2017', '10/05/2017', 'Se busca persona para reparaciones de bicicletas', 'Garaio', 'Coche', 'Cualquiera', 39),
(67, 5, '09/05/2017', '19/05/2017', 'Quieren contar con estudiantes de Grado Superior dispuestos a trabajar en mantenimiento de las titulaciones:\r\n·       Mantenimiento Electrónico\r\n·       Mecatrónica industrial\r\n·       Transporte y mantenimiento de vehículos (automoción)\r\n·       Diseño Mecánico / Programación de la Producción\r\n\r\nSu intención es darles experiencia internacional, por lo que se requeriría un nivel de inglés B2 (no hace falta estar certificado pero preferible), así como interés por desarrollarse profesionalmente en', 'Vitoria', 'Cualquiera', 'Cualquiera', 40),
(68, 5, '12/05/2017', '26/05/2017', 'Necesitamos un OFICIAL ELECTROMECÁNICO DE 1ª , para un centro de trabajo perteneciente a la Industria Química que tenemos en Llodio (Álava), concretamente para el mantenimiento electromecánico del mismo. Se trata de un puesto con carácter estable.', 'Llodio', 'Cualquiera', 'Cualquiera', 41),
(69, 5, '16/05/2017', '13/06/2017', 'Deloitte es la firma de Servicios Profesionales líder en España y en el mundo. Estamos orientados hacia la formación, la promoción e impulso de nuestro capital humano, la excelencia empresarial, y a mantener el reconocimiento como la firma que da el mejor servicio a sus clientes en las líneas de Auditoría, Consultoría, Asesoramiento Fiscal y Legal, Asesoramiento en Transacciones, Outsourcing de Procesos de Negocio y Tecnología.\r\n\r\nNuestra organización cuenta con más de 6.000 profesionales en Esp', 'Bilbao', 'Cualquiera', 'Cualquiera', 42),
(70, 15, '18/05/2017', '25/05/2017', 'La empresa Arteche, ubicada en Jundiz y dedicada a la fabricación de transformadores de medida, busca una persona con perfil eléctrico para trabajar en su laboratorio de alta tensión.', 'Vitoria', 'Cualquiera', 'Cualquiera', 43),
(72, 93, '18/05/2017', '29/05/2017', 'Prueba de oferta.', 'Vitoria-Gasteiz', 'Cualquiera', 'Cualquiera', 45),
(73, 15, '18/05/2017', '25/05/2017', 'SIEMENS; Estamos buscando a antiguos alumnos o a punto de graduarse para una oferta de empleo basada en técnicos de mantenimiento electromecánico para un puesto en Vitoria.\r\nBuscamos un perfil más mecánico aunque especializado en electricidad, aunque estamos abiertos a otro tipo de perfiles. ', 'Vitoria', 'Cualquiera', 'Cualquiera', 46),
(74, 15, '18/05/2017', '26/05/2017', 'Hola, estamos probando una nueva herramienta de bolsa de empleo. Por favor, si recibís este correo hacédmelo saber. Probad a darle a los enlaces: Estoy interesado / No estoy interesado. GRACIAS!! Jose Ignacio', 'Vitoria', 'Cualquiera', 'Cualquiera', 47),
