(85, 15, '02/06/2017', '09/06/2017', '	Funciones del puesto \r\n\r\nRecepción y comprobación de los RMA’s\r\nComprobación y preparación de productos re acondicionados\r\nTesteo de productos nuevos\r\nTareas de logística \r\nPreparación de envíos\r\n\r\nCualidades profesionales requeridas\r\n\r\nOrganización \r\nCapacidad de analizar y detectar fallos\r\nApertura a los cambios\r\nCooperación y trabajo en equipo  \r\nPersona proactiva\r\n\r\nOTROS REQUISITOS/OBSERVACIONES\r\nConocimientos informáticos en hardware y software\r\nSe valorarán conocimientos y experiencia en', 'Vitoria', 'Cualquiera', 'Cualquiera', 58),
(86, 15, '06/06/2017', '09/06/2017', 'FAGOR-electrónica necesita seleccionar para 3 meses aproximadamente alumnos de Mantenimiento Electrónico o Automatización y Robótica.', 'Arrasate', 'Cualquiera', 'Cualquiera', 59),
(87, 15, '07/06/2017', '09/06/2017', 'Se busca técnico en instalación de cableados estructurados tanto en cobre como en fibra óptica: cableado, racks, etc. También instalaciones eléctricas. Debe tener experiencia en fibra óptica.', 'Vitoria', 'Coche', 'Cualquiera', 60),
