(92, 95, '19/06/2017', '23/06/2017', 'Tengo una oferta de trabajo:\r\nSe trata de GRUPO ONAINDIA.\r\nBuscan una persona Joven. No es necesaria experiencia.\r\nTareas básicas: atención al cliente y trabajos advos sencillos\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 65),
(93, 93, '20/06/2017', '22/06/2017', 'Auxiliar de Enfermería para trabajar en Clínica dental realizando labores de ayuda al dentista, atención al cliente, etc.\r\nPosible continuidad.\r\nHorario: Lunes a Viernes de 9:30-13:00 y 17:30 a 20:00\r\nPara inscribirse en la oferta será necesario actualizar y añadir en la aplicación el CV.', 'Vitoria', 'Cualquiera', 'Cualquiera', 66),
(94, 95, '20/06/2017', '22/06/2017', 'Oferta de empleo:\r\nAlbersa Jamones y embutidos pide un administrativ@\r\nPara realizar diferentes trabajos administrativos', 'Vitoria', 'Cualquiera', 'Cualquiera', 67),
(95, 95, '20/06/2017', '23/06/2017', 'Tengo una oferta de empleo de JUSABI motor\r\nBuscan un administrativ@ para \r\nAtención al cliente\r\nElaboración de presupuestos\r\nGestión de programa propio\r\n\r\nOs recuerdo que:\r\nNo me tenéis que enviar un correo para indicarme que estáis interesados en la oferta. Indicarlo en la propia oferta.\r\nTampoco me enviéis el CV actualizado porque yo ya no puedo actualizarlo.\r\nPara actualizar datos incluido el CV:\r\nEntrar en: http://bolsaempleo.egibide.org/\r\ncambiar los datos necesarios y adjuntar el CV\r\nIMPO', 'Vitoria', 'Cualquiera', 'Cualquiera', 68),
(96, 15, '23/06/2017', '27/06/2017', 'Se busca perfil de programación,BBDD,… .El contrato se haría por julio, agosto y septiembre', 'Vitoria', 'Cualquiera', 'Cualquiera', 69),
