(98, 5, '23/06/2017', '07/07/2017', 'administatibo baten bila gabiltza.\r\n \r\nAdministrazio Goi Mailako ikasketak egindako ikasleak bilatzen ari gara.\r\n \r\nBilatzen ari diren perfila hauxe da:\r\n \r\n- Administrazioan goi mailako ikasketak\r\n- Euskaraz jakin behar du\r\n\r\n \r\nMelanie Mancilla Ruiz \r\nAdministrazio Koordinadorea - Coordinadora de Administración\r\nmelani.mancilla@imqprevencion.es\r\nIMQ Prevención\r\nAvenida de los Olmos, 1 Edificio Inbisa D1 Oficina 004\r\n01013 VITORIA - GASTEIZ\r\nT. 945 00 98 98 / F. 945 26 06 21', 'Vitoria', 'Cualquiera', 'Cualquiera', 71),
(99, 95, '26/06/2017', '29/06/2017', 'Oferta de empleo: en GRUAS Y TALLERES PALETA buscan una persona con carácter para gestión de los chóferes, Atención al teléfono y Contabilidad básica\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 72),
(100, 95, '26/06/2017', '28/06/2017', 'Oferta de empleo:\r\nDesde la empresa VALVULERÍAS DEL NORTE, para su centro logístico de Júndiz nos piden persona madura para gestión de almacén.', 'Vitoria', 'Cualquiera', 'Cualquiera', 73),
(101, 15, '26/06/2017', '29/06/2017', 'Se buscan desarrolladores de J2EE, Java. Spring e Hibernate o cualquier framework de desarrollo.\r\n ', 'Miñano', 'Cualquiera', 'Cualquiera', 74),
(102, 15, '28/06/2017', '04/07/2017', 'Empresa dedicada al suministros y mantenimiento industrial, busca una persona para cubrir un puesto.  El perfil que buscamos es alguien con conocimientos de neumática e hidráulica para trabajar tanto en el departamento hidráulico como en almacén general.', 'Vitoria', 'Cualquiera', 'Cualquiera', 75),
(103, 95, '28/06/2017', '30/06/2017', 'Hemos recibido una oferta de empleo de DERTEN Software de gestión.\r\nBuscan una persona proactiva, con una beca del SEA  (Sindicato Empresarial Alavés) de 5 meses de 500 € mensuales, para llevar labores advas.(facturación, pedidos, etc). Incluye la cotización a la S.S.\r\nHay muchas posibilidades de contratación posterior.\r\nQuieren especialmente una persona que haya terminado el CF en estos últimos años\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 76),
(104, 95, '29/06/2017', '30/06/2017', 'Oferta de empleo de la empresa SOFTCAD, S.L. situada en la calle Avda. Los Olmos, 1 Edif. DIII  Ofic. 133\r\nBuscan una chica por temas de paridad, con don de gentes y responsable (atención al público)\r\nResidencia en Vitoria-Gasteiz.\r\nEuskera: mínimo B2.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 77),
(105, 95, '03/07/2017', '06/07/2017', 'Oferta de empleo de NEUFIS FISIOTERAPIA.\r\nBuscan un auxiliar administrativo o de grado superior para atención al público', 'Vitoria', 'Cualquiera', 'Cualquiera', 78),
(106, 95, '05/07/2017', '07/07/2017', '0ferta de empleo de DERTEN Software de gestión\r\nBeca de 5 meses del SEA (Sindicato Empresarial Alavés)\r\nBuscan: una persona proactiva, con una beca de 5 meses de 500 € mensuales, para llevar labores advas. Incluye la cotización a la S.S.\r\nHay muchas posibilidades de contratación posterior.\r\n(facturación, pedidos, etc)\r\nRequisitos:\r\n- Residentes Alava\r\n- Desempleo\r\n- Haber terminado 2 en año  2015. 2016 o 2017\r\n- 30 años máximo.\r\nES URGENTE', 'Vitoria', 'Cualquiera', 'Cualquiera', 79),
(107, 15, '06/07/2017', '11/07/2017', 'Se buscan personas para trabajar en altas de fibra óptica ftth', 'Vitoria', 'Coche', 'Cualquiera', 80),
(108, 95, '06/07/2017', '08/07/2017', 'Oferta de empleo de la empresa ZENER PLUS sita en la C/ Bekolarra 2 nave 30.\r\nBuscan un advo para atención al cliente, emisión de informes, etc.\r\nEl trabajo es a jornada completa\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 81),
(109, 93, '11/07/2017', '13/07/2017', 'Desde la empresa Grupo Norte, piden CV para trabajar en sus residencias.\r\nRemitiremos el de aquellas personas que estén interesadas en formar parte de su bolsa de trabajo.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 82),
(110, 20, '11/07/2017', '18/07/2017', 'La empresa EUROPLANIN PROGRAMS S.L  desea contratar a un técnico informático con conocimientos de:\r\n​-bases de datos (tipo MySQL) gestionadas con MariaDB.\r\n - ​Lenguaje PHP y manejo de PHPMYadmin.\r\n-HTML y Javascript\r\n \r\n​', 'Vitoria', 'Cualquiera', 'Cualquiera', 83),
(111, 94, '12/07/2017', '29/07/2017', '1. ¿En qué consiste “On4u Developer Mentoring Program”?\r\nEs un programa de mentoring que pretende ofrecer a jóvenes recién titulados una oportunidad real de inmersión en el mercado laboral, ayudando al participante a desarrollar su carrera más allá de la propia formación académica, a través del aprendizaje basado en el “learn by doing”.\r\nSe trata de encontrar el talento de los jóvenes desarrolladores, potenciarlo y enfocarlo a una carrera profesional de futuro.\r\nEn los 6 meses que dura el mentor', 'Vitoria', 'Cualquiera', 'Cualquiera', 84),
(112, 93, '12/07/2017', '14/07/2017', 'Se ofrece empleo con Auxiliar Educativo en el Centro de Menores de Nuevo Futuro en Estíbaliz.\r\nEl horario sería de noche (23:00-7:00) una semana si una no.\r\nSolicitan un chico.\r\nOfrecen contrato estable.\r\nLos interesados, subir vuestro CV a la aplicación.', 'Estíbaliz (Álava)', 'Cualquiera', 'Cualquiera', 85),
(113, 15, '12/07/2017', '17/07/2017', 'Técnico de Servicio para el entorno de Autoservicio. Esto es, mantenimiento de cajeros automáticos en entidades financieras y otros dispositivos similares en dicho entorno.\r\n \r\nEl perfil idóneo es un joven que haya terminado sus estudios de electrónica e informática y si combina ambos, mejor. Estos dispositivos tienen tanto un componente de informática como de electrónica y mecánica (impresoras y módulos con elementos como rodillos que se desgastan y deterioran, correas, engranajes, etc… ).\r\n \r\n', 'Vitoria', 'Coche', 'Cualquiera', 86),
(114, 15, '13/07/2017', '18/07/2017', 'Se busca 1 persona para la apoyar en la Sección de Nuevos Proyectos, alguien con estudios de Automoción con conocimientos eléctricos.\r\n \r\nEntre las funciones que realizará están las siguientes:\r\n- Desmontaje y montaje de cualquier componente del vehículo.\r\n- Diagnosis en general.\r\n- Sustitución de unidades de control y diferentes componentes.\r\n- Reproducción de averías.\r\n- Diagnostico de averías.\r\n- Realizar matriz de errores posibles.\r\n- Propuestas de mejora al mercado.\r\n ', 'Vitoria', 'Cualquiera', 'Cualquiera', 87),
(115, 95, '14/07/2017', '17/07/2017', 'La empresa de logística TRANSPORTES IRIARTE ECHEVARRIETA S.A situada en Nanclares quiere un administrativo para facturación y otros trabajos advos.\r\nImprescindible buen nivel de INGLÉS. Se valora francés.\r\nSaludos Fernando\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 88),
(116, 15, '15/07/2017', '19/07/2017', 'Se necesita una persona con conocimientos eléctricos para una empresa situada en Júndiz.\r\n \r\nSería para incorporación inmediata, a jornada completa de 7 a 15 horas.\r\n \r\nEn principio, para tres semanas hasta las vacaciones y luego para contrato de 6 meses con posibilidad de renovación.', 'Vitoria', 'Cualquiera', 'Cualquiera', 89),
(117, 15, '15/07/2017', '19/07/2017', 'Empresa de montaje eléctrico en BT necesita cubrir varios puestos de Oficial electricista. Trabajos  en montaje industrial y en obra civil.\r\nPersonas que  han terminado su preparación  y tengan ganas de trabajar y aprender.', 'Vitoria', 'Cualquiera', 'Cualquiera', 90),
(118, 15, '16/07/2017', '19/07/2017', 'Este año nuestra participación \"ambiental\" en el Txupinazo va  a ser diferente. Acudiremos con 40 alumnos/as y ex-alumnas/os, voluntarios y voluntarias de Eguibide. Su misión consiste en proponer a quienes se acerquen con una botella de vidrio, a vaciar su contenido en un “katxi” que se les ofrecerá en ese momento y depositar la botella vacía en uno de los 2 ó 3 contenedores pequeños\r\nEsta acción tiene una compensación económica para nuestro alumnado o ex-alumnado participante, a cargo del Ayunt', 'Vitoria', 'Cualquiera', 'Cualquiera', 91),
(119, 5, '19/07/2017', '15/08/2017', 'Estamos buscando una persona con amplios conocimientos de informática. Herramientas como Excel, Acces y diferentes bases de datos. Vamos a cambiar el sistema informático y necesitamos algún apoyo para la exportación de datos del ERP actual y preparación para la importación en el siguiente ERP. Así como puesta en marcha, carga de imágenes, datos, tarifas etc. en un futuro próximo prevemos crear una Intranet para clientes, una web de comercio online así como mantener nuestra actual web corporativa', 'Vitoria', 'Cualquiera', 'Cualquiera', 92),
