(283, 97, '22/02/2018', '02/03/2018', 'De ELECTRA VITORIA nos han pedido gente para trabajar en máquinas; les encajan bien chicos o chicas que hayan estudiado C.M. Mantenimiento o C.S. Mecatrónica, pero podrían acceder también con otros estudios si tienen disposición para las máquinas.  En principio el trabajo es para máquinas, después, depende de lo que se demuestre, está la posibilidad real de pasar a mantenimiento y montaje en la calle.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 256),
