(287, 5, '02/03/2018', '13/03/2018', 'Peón/a vigilante de mantenimiento\r\n\r\nFormará parte de un equipo, realiza la limpieza exterior, control de acceso, vigilancia interior y mantenimiento de las instalaciones y equipamientos de la Fundación para garantizar un entorno óptimo para la práctica deportiva y el ocio de las personas abonadas y usuarias. Periodo de trabajo, del 1 de junio al 30 de septiembre\r\n\r\nRetribución bruta anual: 26.285.64 €/año\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 260),
