(311, 94, '28/03/2018', '13/04/2018', 'Ocupación : DISEÑADORES DE PÁGINAS WEB\r\nNúmero de puestos ofrecidos : 1\r\nUbicación de puesto ofrecido : ARRASATE/MONDRAGON\r\nFunciones : diseñador/a para maquetación frontend con conocimientos en HTML y Angular. realizar adaptación de\r\ndiseños, maquetación HTML, desarrollo de plantillas, integración angular.\r\nRequisitos : Mínimo CFGM con al menos 3 años de experiencia. Conocimientos de ANGULAR, HTML. Experiencia en\r\nmaquetación y diseño web\r\nContrato: Contrato Inicial de 1 año prorrogable', 'Arrasate', 'Cualquiera', 'Cualquiera', 284),
