(338, 94, '16/04/2018', '08/06/2018', 'Son una consultora de seguridad y tienen un área de ciberseguridad con un proyecto nuevo para el que necesitan personal. Estan pensando en gente joven con estudios  en administración de redes, informática, telecomunicaciones o similar.\r\nEl trabajo principalmente consiste en el manejo de SOCKs para monitorización de redes de clientes. Se necesita conocimientos de redes. A nivel de ciberseguridad, no dan mucha importancia al grueso de lo aprendido en clase ya que las personas contratadas recibirán', 'Miñano (Araba)', 'Cualquiera', 'Cualquiera', 311),
(339, 14, '17/04/2018', '24/04/2018', 'Se busca personal para sustituciones en vacaciones de verano; para cubrir calendario de empleo de entre 6 o 8 horas.\r\nEl trabajo consiste en salir a pasear con personas usuarias de distintas residencias de Vitoria y pueblos de alrededores durante una hora.\r\nPreferiblemente con coche.', 'Vitoria', 'Cualquiera', 'Cualquiera', 312),
(340, 15, '17/04/2018', '20/04/2018', 'Descripción de la oferta: Instalación de cableado UTP o fibra desde rack hasta AP. Instalación AP, rack, swich, pach panel, conexión eléctrica a cuadros.\r\nElaboración de informes y documentación asociada a cada una de las tareas de campo.', 'Vitoria', 'Cualquiera', 'Cualquiera', 313),
