(342, 5, '19/04/2018', '26/04/2018', '\r\nAAC Centro de Acústica Aplicada, S.L.\r\n\r\nPERFIL DEL PUESTO:\r\nTécnico de medida y de laboratorio, a jornada completa, para realizar funciones de:\r\n• Participación y manejo de instrumentación en mediciones de ruido y vibraciones en\r\nindustria, edificación y medio ambiente.\r\n• Tratamiento de datos, análisis y presentación de resultados.\r\n• Colaboración para la mejora de sistemas de medida\r\n• Ensayos de calibración y verificación de equipos.\r\n• Informatización de procesos y comunicación de equipos', 'Vitoria', 'Cualquiera', 'Cualquiera', 315),
(343, 5, '19/04/2018', '26/04/2018', 'Empresa del sector de automoción ofrece posibilidad de incorporar a algún recién titulado en CFGS en calidad de becario.\r\n\r\nEl puesto estaría integrado dentro del departamento de logística, con lo cual estaríamos hablando de recién titulados de ciclos relacionados con ello, p.e.\r\n\r\n-          Administracion y Finanzas\r\n-          Automoción\r\n\r\n El periodo de beca sería de aprox. 9 meses, incorporación inmediata, jornada de 7 horas diarias, y el recién titulado no puede haber tenido experiencia l', 'Vitoria', 'Cualquiera', 'Cualquiera', 316),
