(461, 97, '04/09/2018', '14/09/2018', 'Buenos días,\r\n\r\nOs escribo de Ayudas Técnicas Araba SL (nos dedicamos al suministro de material en residencias de ancianos y hospitales).\r\n\r\nNecesitamoss currículums de cara a posibilidad de incorporar un trabajador para realizar trabajo de repartidor y montador, ayudar al servicio técnico a reparación de grúas, camas, etc. para que vaya aprendiendo el trabajo que realizamos.\r\n\r\nAgradecería si nos puedes remitir currículums de algún perfil que nos encaje, con alguna titulación de servicio técnic', 'Vitoria', 'Cualquiera', 'Cualquiera', 434),
(462, 97, '04/09/2018', '14/09/2018', 'Buenos días, necesitamos un mecánico/a de mantenimiento con conocimientos de electricidad y fontanería para tareas de reparación y mantenimiento.\r\nCon Carnet de conducir y experiencia de 6 meses', 'Vitoria', 'Coche', 'Cualquiera', 435),
(463, 97, '04/09/2018', '14/09/2018', '	Para nuestro Laboratorio de Calibración de Vitoria-Gasteiz precisamos incorporar un técnico de calibración de máquinas y equipos de ensayo.\r\nInicialmente el puesto sería de auxiliar hasta completar el proceso de formación. Pasado este proceso, y ya como técnico, el nivel salarial sería igual o superior a 22.000 € .\r\n\r\nEl puesto requiere desplazarse a empresas del País Vasco -Navarra y Burgos .\r\nEl contrato es indefinido.\r\nNo se requiere experiencia previa aunque se valora el haber trabajado, a ', 'Vitoria', 'Cualquiera', 'Cualquiera', 436),
