(580, 5, '07/11/2018', '14/11/2018', 'PROIMA\r\n\r\nSe busca Técnico de instalaciones y mantenimiento de calefacción.  Nos sirve cualquier perfil técnico, ya que se le formará inicialmente.\r\n\r\nFunciones:\r\n- Revisión periódica de sala de calderas, paneles solares, etc. en instalaciones térmicas\r\n- Instalador de sistemas de calefacción, gas, energías renovables, vapor, etc.\r\n- Realizar trabajos de reparación, ajustes, regulación, sustitución de piezas en instalaciones térmicas.\r\n\r\nExperiencia:\r\n- Conocimiento en instalaciones térmicas ind', 'Vitoria', 'Cualquiera', 'Cualquiera', 553),
