(585, 95, '13/11/2018', '23/11/2018', 'Oferta de empleo de FIDELIZA.\r\nNecesitan para cubrir un puesto laboral de unas horas a la semana, para la dinamización de una campaña educativa sobre finanzas.\r\nFormación académica a nivel de bachillerato o superior. Preferiblemente personas con  formación en el área social, magisterio en la rama economía  o similar.\r\nFormación en el ámbito del tiempo libre y animación: título de monitor/a de tiempo libre o animador/a sociocultural, …\r\nContar con una experiencia continuada en tareas de animación', 'Vitoria', 'Cualquiera', 'Cualquiera', 558),
