(589, 5, '20/11/2018', '27/11/2018', 'CASLEVER.  YARRITU S.A.\r\n\r\nEmpresa que busca personal con formación en Grado Superior en Electricidad y Electrónica. Las labores fundamentales serian los mantenimientos de la playa de peajes de Luko y Etxabarri-Ibiña y el tunel de Luko.', 'Vitoria', 'Cualquiera', 'Cualquiera', 562),
(590, 41, '20/11/2018', '30/11/2018', 'Queremos cubrir una vacante en el dpto de I+D de una empresa tecnológica. Es un puesto de larga duración, enfocado a redes, telefonía IP, Videoconferencia,... \r\nNecesitamos a una persona que haya finalizado los estudios de FP II en \"Sistemas de Telecomunicaciones e Informáticos\". También tiene que tener conocimientos de inglés (aprox. nivel First).\r\n\r\nNo es necesario que tenga experiencia', 'Vitoria', 'Cualquiera', 'Cualquiera', 563),
(591, 41, '20/11/2018', '30/11/2018', 'Necesitamos para nuestro almacén de Lantaron una persona con conocimientos de electricidad en maquinaria. Bajo la supervisión del responsable electrico de la empresa, realizará labores de revisión, mantenimiento y reparación de los equipos de trabajo de la empresa (máquinas de soldar, cuadros electricos, taladros, pistolas impacto...)', 'Vitoria', 'Cualquiera', 'Cualquiera', 564),
