(593, 95, '21/11/2018', '30/11/2018', 'Oferta de empleo de: MORISPAIN,SA\r\nBuscan un administrativ@ menor de 30 años y que tenga terminado el CF antes de 5 años para poder hacer un contrato en prácticas.\r\nPara incorporarse al departamento de ventas e ir realizando la formación durante su contrato, pero para hacer labores exclusivas de administrativo.\r\nDeberá tener conocimientos administrativos e informáticos a nivel de usuario. \r\nIntención de pasar posteriormente a indefinido.', 'Vitoria', 'Cualquiera', 'Cualquiera', 566),
