(595, 97, '22/11/2018', '30/11/2018', 'Estamos buscando técnicos de Puesta en Servicio para la planta de Rivabellosa, pero con la opción de poder viajar al extranjero.\r\nSerían quienes realizarían todas las pruebas estáticas y dinámicas de todos los elementos tanto eléctricos como mecánicos que se han montado en el tren.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 568),
(596, 93, '22/11/2018', '26/11/2018', 'CLINICA EDUARDO ANITUA, empresa ubicada en VITORIA, líder en la investigación y desarrollo de productos Biotecnológicos dentro del campo de la IMPLANTOLOGÍA ORAL y REGENERACIÓN TISULAR, precisa incorporar un/a:\r\nTécnico en Cuidados Auxiliares de Enfermería\r\n\r\n-Funciones:\r\nGestión del mantenimiento y la organización de los gabinetes\r\nAsistencia a odontólogos \r\nDistribución de tiempos de tratamiento \r\nControl de la agenda\r\n\r\n-Experiencia:\r\nSe valorará positivamente experiencia en clínica dental.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 569),
(597, 14, '23/11/2018', '27/11/2018', 'Puesto: Formador/a de Castellano y Euskera\r\nLugar: Centro de Atención Sociolaboral de ADRA en Vitoria – Gasteiz \r\nJornada: Tiempo parcial (60%).\r\nDESCRIPCIÓN:\r\nImpartir formación de euskera y cultura vasca en un nivel a mujeres y hombres de origen extranjero. E impartir formación de castellano de varios niveles a mujeres y hombres de origen extranjero, realizando las siguientes funciones:\r\n Preparación de materiales para impartir las clases.\r\n Realizar el seguimiento de cada alumno/a conjuntam', 'Vitoria', 'No', 'Cualquiera', 570),
(598, 39, '26/11/2018', '26/12/2018', 'Se necesita un metrologo para taller de mecanizado. Se requiere experiencia en el area de la metrologia.', 'Vitoria', 'Cualquiera', 'Cualquiera', 571),
(599, 39, '26/11/2018', '26/12/2018', 'Seleccionamos para trabajar en la empresa Análisis y Simulación un/a técnico de producción por mecanizado para desempeñar funciones de Mecanizado y programación ISO.\r\nSe valorará la experiencia y los conocimientos de CAM con NX.', 'Vitoria', 'Cualquiera', 'Cualquiera', 572),
(601, 95, '29/11/2018', '14/12/2018', 'Oferta de empleo de: RODALSA\r\nBuscan una persona para una sustitución para una baja por maternidad.\r\nLas tareas a realizar serían las propias de un puesto administrativo, gestión contable, tesorería, atención telefónica, gestión de albaranes y pedidos.\r\nLa incorporación seria mas o menos inmediata pudiendo ser a mediados de diciembre.\r\nSeria para un puesto en jornada parcial a 4 horas, y posteriormente a 6 horas, tras que la persona a sustituir empiece su baja.\r\n\r\n ', 'Vitoria', 'Cualquiera', 'Cualquiera', 574),
(602, 95, '29/11/2018', '14/12/2018', 'Oferta de empleo de GESTORIA BENGOA\r\nPara un puesto de trabajo de administrativo. Sería para hacer las gestiones en los diferentes organismos con los que tratan diariamente. Sería un contrato de unas tres horas diarias. Sería temporal pero con vistas a convertirlo en indefinido.', 'Vitoria', 'Cualquiera', 'Cualquiera', 575),
