(606, 15, '04/12/2018', '10/12/2018', 'A principios de 2019 OREKA IT vuelve a ofertar una nueva academia de programación ABAP.  La formación es gratuita, presencial en horario de mañana en nuestras oficinas durante 204 horas, y con posibilidad de incorporación a plantilla en puesto estable, una vez finalizada la academia.  Las fechas aún están por concretar. Buscamos perfiles de estilo programador@ o informátic@, con o sin experiencia.', 'Vitoria', 'Cualquiera', 'Cualquiera', 579),
