(610, 97, '09/12/2018', '21/12/2018', 'Se precisa de técnico de mantenimiento para realizar y coordinar el mantenimiento preventivo y correctivo en la planta de producción de la Panificadora Gorbea. En las instalaciones hay equipos y sistemas mecánicos, eléctricos, electrónicos, neumáticos, robóticos (robots KUKA),...\r\n\r\nInteresa gente dispuesta a aprender, preferíblemente mecatrónicos (o titulación equivalente) pero se consideran válidas personas en posesión del título de grado medio de mantenimiento electromecánico u otro tipo de t', 'Vitoria', 'Cualquiera', 'Cualquiera', 583),
