(626, 39, '07/01/2019', '07/02/2009', 'Se requiere una persona para trabajar en oficina técnica, con muchas ganas de aprender un oficio nuevo, puesto que el Grabado Industrial no se enseña en las escuelas de formación profesional  También se valorará la destreza en el taller, aunque no es imprescindible.\r\nEs absolutamente necesario el dominio de Autocad, Catia o similares.\r\n', 'Vitoria', 'Cualquiera', 'Cualquiera', 599),
(627, 97, '08/01/2019', '11/01/2019', 'Importante empresa del sector de maquinaria ubicada en Vitoria-Gasteiz, precisa un/a\r\n\r\nTÉCNICO/A ELECTROMECÁNICO DE INSTALACIONES Y MANTENIMIENTO\r\n\r\nSu labor será dar apoyo al departamento técnico relacionado con la instalación y mantenimiento de maquinaria de embotellado y embalaje.\r\nEntre sus funciones principales están preparar en el taller propio la maquinaria que compone las instalaciones, realizar la posterior instalación y montaje de la maquinaria en casa del cliente -para lo que tendrá ', 'Vitoria', 'Cualquiera', 'Cualquiera', 600),
