(629, 41, '09/01/2019', '27/01/2019', 'Se precisa persona para para atender cliente instalador eléctrico profesional en mostrador con conocimientos eléctricos', 'Vitoria', 'Cualquiera', 'Cualquiera', 602),
(630, 5, '09/01/2019', '01/02/2019', 'Puesto vacante:\r\n\r\nADMINISTRATIVO/A DE LOGÍSTICA en Vitoria \r\n\r\nNivel:\r\n\r\nEmpleado/a\r\n\r\nPersonal a cargo:\r\n\r\n0\r\n\r\nNúmero de vacantes:\r\n\r\n4 \r\n\r\nDescripción de la oferta\r\n\r\nPersonal administrativo Bloque logístico.\r\n\r\nJornada Completa 40 h / Semanales. Turnso de tarde y/onoche.\r\n\r\nProgresión salarial.\r\n\r\nFormación a cargo de la empresa.\r\n\r\n \r\n\r\n \r\n\r\nRequisitos\r\n\r\nEstudios mínimos:\r\n\r\nEducación Secundaria Obligatoria\r\n\r\nExperiencia mínima:\r\n\r\nNo requerida\r\n\r\nImprescindible:\r\n\r\nResidente en provinci', 'Vitoria', 'Cualquiera', 'Cualquiera', 603),
(631, 5, '09/01/2019', '01/02/2019', 'MERCADONA\r\nDescripción\r\n\r\n \r\nPuesto vacante:\r\n\r\nMOZO/A ALMACÉN DE BLOQUE LOGÍSTICO en Vitoria\r\n\r\nNivel:\r\n\r\nEmpleado/a\r\n\r\nPersonal a cargo:\r\n\r\n0\r\n\r\nNúmero de vacantes:\r\n\r\n50\r\n\r\nDescripción de la oferta\r\n\r\nPicker y/o Limpieza\r\n\r\nJornada laboral completa.\r\n\r\nFormación a cargo de la empresa.\r\n\r\n 	 \r\nRequisitos\r\n\r\n \r\nEstudios mínimos:\r\n\r\nEducación Secundaria Obligatoria\r\n\r\nExperiencia mínima:\r\n\r\nNo requerida\r\n\r\nImprescindible:\r\n\r\nResidente en provincia del puesto vacante\r\n\r\nRequisitos mínimos:\r\n\r\nDis', 'Vitoria', 'Cualquiera', 'Cualquiera', 604),
(632, 39, '10/01/2019', '14/02/2019', 'Se necesita incorporar una persona a la oficina técnica con conocimientos de Autocad y Catia.\r\nSe valoraran conocimientos de taller pero no es imprescindible.', 'Vitoria', 'Cualquiera', 'Cualquiera', 605),
(633, 41, '11/01/2019', '20/01/2019', 'Buscamos electricistas para Vitoria-Gasteiz, se valorara experiencia en electricidad, se ofrece contrato laboral a jornada completa en horario de 8:00 a 13:00 horas y de  15:00 a 18:00 horas', 'Vitoria', 'Coche', 'En paro', 606),
(634, 97, '11/01/2019', '18/01/2019', 'Se necesita contratar a una o dos personas para el Dpto. de Mantenimiento. El perfil sería preferentemente mecatrónica. No exigiríamos experiencia alguna aunque, lógicamente, si se cuenta con ella (en cualquier nivel) mejor. La pretensión sería formarles internamente.', 'Vitoria', 'Cualquiera', 'Cualquiera', 607),
(635, 95, '15/01/2019', '24/01/2019', 'Oferta de empleo de Arteche:\r\nPara incorporar a una persona lo antes posible, para cubrir una baja maternal. En un principio seria un contrato temporal hasta que comience la baja maternal, la jornada de trabajo seria de 5 horas y 16 minutos, en horario de mañana.\r\nRequisitos:\r\nUna persona que tenga experiencia en contabilidad. Si tiene conocimientos o a trabajado anteriormente con el erp SAP mucho mejor.\r\nQue tenga conocimientos de Microsoft office, principalmente de Excel.\r\nNivel medio de Ingle', 'Vitoria', 'Cualquiera', 'Cualquiera', 608),
(636, 95, '15/01/2019', '24/01/2019', 'Oferta de empleo de: Asesoría Kofer.\r\nBuscan administrativa, preferiblemente chica, para llevar contabilidad, at al cliente, etc.\r\nJornada completa', 'Vitoria', 'Cualquiera', 'Cualquiera', 609);
